import React from 'react';
import team from "../src/svg/team.svg"
import Comon from './comon';
const About=()=> {
  return (
    
      <>
    <Comon title={`Grow your business with`}
      des={ `We have some good developer to making website`}
      button={`Get Started`}
      img={team}/>
    </>
  );
}

export default About;
